// HomeLink.js
import React from 'react';
import { Link } from 'react-router-dom';

function HomeLink() {
  return (
    <h1 style={{ color: '#FFF', cursor: 'pointer' }}>
      <Link to="/" style={{ color: '#FFF', textDecoration: 'none' }}>
        RunningOnData
      </Link>
    </h1>
  );
}

export default HomeLink;
